CREATE TABLE IF NOT EXISTS drinker_profiles(
	`id` INT UNSIGNED NOT NULL AUTO_INCREMENT PRIMARY KEY,
   stressLevel  VARCHAR(9) NOT NULL
  ,jobHours     INTEGER  NOT NULL
  ,familyStatus VARCHAR(16) NOT NULL
  ,drinkLevel   VARCHAR(10) NOT NULL
  ,gender       VARCHAR(6) NOT NULL
  ,drinkTime    VARCHAR(10) NOT NULL
  ,personality  VARCHAR(10) NOT NULL
  ,money        VARCHAR(11) NOT NULL
  ,daysBar      INTEGER  NOT NULL
);
